import React from 'react';
import Logo from '../images/prinscarl_logo.png'
import styled from 'styled-components'

const Header = () => {

    return (
    <>
    <Image src={Logo} alt="Prins Carl Logo" />
    <Navbar>
    <nav class="navMenu">
      <a href="#">Home</a>
      <a href="#">Blog</a>
      <a href="#">Work</a>
      <a href="#">About</a>
      <div class="dot"></div>
    </nav>
    </Navbar>
    </>
    )
}

export default Header;

const Image = styled.img`
height: 80px;
`
